export const fetchData = async(assetID) => {
    const settings = {
        method: 'POST',
        headers: {
            Accept: 'application/json',
            'Content-Type': 'application/json',
        },
        body: 'WT',
        mode: 'no-cors'
    };
    try{
        const response = await fetch(`http://localhost:3000/asset`, settings);
        const asset = await response.json();
        return asset;
    } catch(error) {
        console.log(error);
    }
};
